import React,{ Component } from 'react';
import './style.css';
import axios from 'axios';


class Vip extends Component{

constructor(props){
    super(props)
    this.state={
        login:false,
       
    }
}


componentDidMount(){
    axios.get('http://www.dell-lee.com/react/api/isLogin.json')
    .then(res=>{
        const login=res.data.data.data
        this.setState(login)
    })
}

    render(){
        return <div className="vip" >VIP</div>
    }
}


export default Vip;
